  let i = 0;

  async function nextStep() {
    if (i >= missionSteps.length) {
      let reward = getRandomReward();
      user.balance += reward;
      user.exp += 100;
      user.limit += 10;

      let resultText = `🏆 *MISI GUILD SELESAI!* 🏆\n\n` +
        `⋄ ID Misi: ${sessionData.id}\n` +
        `⋄ Petualang: ${sessionData.number.split(\"@\")[0]}\n` +
        `⋄ Tanggal: ${sessionData.date}\n` +
        `⋄ Taruhan: 200 Koin Emas\n` +
        `⋄ Hadiah: ${reward} Koin Emas\n` +
        `⋄ Saldo Baru: ${user.balance} Koin Emas\n\n` +
        (reward === 3000
          ? `🎉 *LUAR BIASA!* Kamu mendapatkan hadiah besar 3,000 koin!`
          : `💪 Kamu mendapatkan ${reward} koin dari petualanganmu.`) +
        `\n\nKetik \`${m.prefix}balance\` untuk melihat kantong emasmu!`;

      if (sessionData.keyId) {
        await kuromi.sendMessage(sessionData.keyId.remoteJid, { delete: sessionData.keyId });
      }

      if (global.config.button) {
        await kuromi.sendbut(
          m.chat,
          resultText,
          \"Lihat kantong emasmu!\",
          [[\"Cek Saldo\", m.prefix + \"balance\"]],
          m
        );
      } else {
        await kuromi.reply(m.chat, resultText, m);
      }

      clearSession(m.sender);
      return;
    }

    await kuromi.reply(m.chat, `⚔️ *Langkah ${i + 1}* ⚔️\n${missionSteps[i]}`, m);
    i++;
    sessionData.timeout = setTimeout(nextStep, 2000);
  }

  nextStep();
}

exports.run = {
  usage: [\"misiguild\"],
  hidden: [\"guildmisi\", \"misi\"],
  category: \"rpg\",
  async: async (m, { func, kuromi }) => {
    let user = global.db.users[m.sender] || { balance: 0, limit: 10, exp: 0, missionCount: 0, lastMissionDate: \"\" };
    global.db.users[m.sender] = user;

    if (m.text.startsWith(m.prefix + \"balance\")) {
      let balanceText = `💰 *KANTONG EMAS PETUALANG* 💰\n\n` +
        `⋄ Petualang: ${m.sender.split(\"@\")[0]}\n` +
        `⋄ Koin Emas: ${user.balance} Koin\n` +
        `⋄ Misi Hari Ini: ${user.missionCount}/3\n\n` +
        `Kumpulkan lebih banyak koin dengan menjalani Misi Guild! Ketik \`${m.prefix}misiguild\` untuk memulai.`;
      await kuromi.reply(m.chat, balanceText, m);
      return;
    }

    if (temporaryDatabase[m.sender]?.session) {
      if (global.config.button) {
        kuromi.sendbut(
          m.chat,
          \"⚔️ *MISI SEDANG BERJALAN* ⚔️\nKamu sudah memulai misi Guild sebelumnya!\",
          \"Batalkan misi sebelumnya untuk memulai yang baru?\",
          [[\"Batalkan Misi\", \"batal\"]],
          m
        );
      } else {
        kuromi.reply(
          m.chat,
          \"⚔️ *MISI SEDANG BERJALAN* ⚔️\nKamu sudah memulai misi Guild sebelumnya!\nKetik *Batal* untuk membatalkan misi.\",
          m
        );
      }
      return;
    }

    let missionLimit = checkMissionLimit(m.sender);
    if (!missionLimit.status) {
      await kuromi.reply(m.chat, missionLimit.message, m);
      return;
    }

    let missionText = `🗡️ *MISI GUILD LEGENDA* 🗡️\n\n` +
      `Selamat datang, Petualang! Tantang dirimu dalam Misi Guild untuk memenangkan *200-3,000 Koin Emas*!\n` +
      `- *Taruhan*: 200 Koin Emas\n` +
      `- *Hadiah*: 200–3,000 Koin Emas (peluang 3% untuk hadiah besar!)\n` +
      `- *Proses*: 5 tahap, masing-masing 2 detik\n` +
      `- *Batas*: 3 misi per hari (sisa: ${3 - user.missionCount})\n\n` +
      `Apakah kamu siap bertaruh 200 koin untuk memulai misi ini?`;

    let keyId;
    if (global.config.button) {
      keyId = (
        await kuromi.sendbut(
          m.chat,
          missionText,
          \"Pilih untuk memulai atau mundur dari misi!\",
          [[\"Mulai Misi\", \"mulai\"], [\"Mundur\", \"batal\"]],
          m
        )
      ).key;
    } else {
      keyId = (
        await kuromi.reply(
          m.chat,
          missionText + \"\n\nKetik *Mulai* untuk memulai misi atau *Batal* untuk mundur.\",
          m
        )
      ).key;
    }

    temporaryDatabase[m.sender] = {
      session: \"konfirmasi_misi\",
      id: crypto.randomBytes(5).toString(\"hex\").toUpperCase(),
      number: m.sender,
      name: m.pushname,
      date: moment.tz(\"Asia/Jakarta\").format(\"DD MMMM YYYY\"),
      keyId: keyId,
    };
  },

  main: async (m, { func, kuromi }) => {
    function clearSession(sender) {
      if (temporaryDatabase[sender]) {
        let { timeout } = temporaryDatabase[sender];
        if (timeout) clearTimeout(timeout);
        delete temporaryDatabase[sender];
      }
    }

    let sessionData = temporaryDatabase[m.sender];
    if (!sessionData) return;

    if (sessionData.session === \"konfirmasi_misi\") {
      if (/^(mulai|lanjut)$/i.test(m.budy)) {
        sessionData.session = \"cek_saldo\";
        let check = checkBalance(m.sender, 200);
        if (!check.status) {
          if (sessionData.keyId) {
            await kuromi.sendMessage(sessionData.keyId.remoteJid, { delete: sessionData.keyId });
          }
          await kuromi.reply(m.chat, check.message, m);
          clearSession(m.sender);
          return;
        }

        let user = global.db.users[m.sender];
        user.missionCount = (user.missionCount || 0) + 1;
        user.balance -= 200;

        await kuromi.reply(m.chat, \"⚔️ Petualangan dimulai...\nBersiaplah menghadapi tantangan!\", m);
        runMissionSteps(m, kuromi, sessionData, user, clearSession);

      } else if (/^(batal|mundur)$/i.test(m.budy)) {
        if (sessionData.keyId) {
          await kuromi.sendMessage(sessionData.keyId.remoteJid, { delete: sessionData.keyId });
        }
        await kuromi.reply(m.chat, \"⛔ Misi Guild dibatalkan. Kembalilah saat kamu siap, Petualang!\", m);
        clearSession(m.sender);
      }
    }
  },
  location: \"plugins/rpg/misiguild.js\",
};
